import React, { useState } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import './AngleCharts.css';

const AngleCharts = ({ angleData }) => {
  const [selectedAngles, setSelectedAngles] = useState(['elbow_L', 'elbow_R', 'knee_L', 'knee_R']);

  if (!angleData || angleData.length === 0) {
    return (
      <div className="angle-charts">
        <h3>Joint Angles</h3>
        <p>No angle data available</p>
      </div>
    );
  }

  // Convert angle data to radians for display
  const chartData = angleData.map(item => ({
    time: item.t,
    elbow_L: (item.elbow_L * 180 / Math.PI).toFixed(1), // Convert to degrees
    elbow_R: (item.elbow_R * 180 / Math.PI).toFixed(1),
    knee_L: (item.knee_L * 180 / Math.PI).toFixed(1),
    knee_R: (item.knee_R * 180 / Math.PI).toFixed(1),
  }));

  const angleOptions = [
    { key: 'elbow_L', label: 'Left Elbow', color: '#ff6b6b' },
    { key: 'elbow_R', label: 'Right Elbow', color: '#4ecdc4' },
    { key: 'knee_L', label: 'Left Knee', color: '#45b7d1' },
    { key: 'knee_R', label: 'Right Knee', color: '#f9ca24' },
  ];

  const toggleAngle = (angleKey) => {
    setSelectedAngles(prev => 
      prev.includes(angleKey) 
        ? prev.filter(a => a !== angleKey)
        : [...prev, angleKey]
    );
  };

  const CustomTooltip = ({ active, payload, label }) => {
    if (active && payload && payload.length) {
      return (
        <div className="custom-tooltip">
          <p className="tooltip-time">Time: {label.toFixed(2)}s</p>
          {payload.map((entry, index) => (
            <p key={index} style={{ color: entry.color }}>
              {entry.dataKey}: {entry.value}째
            </p>
          ))}
        </div>
      );
    }
    return null;
  };

  return (
    <div className="angle-charts">
      <h3>Joint Angles Over Time</h3>

      <div className="angle-controls">
        {angleOptions.map(option => (
          <label key={option.key} className="angle-checkbox">
            <input
              type="checkbox"
              checked={selectedAngles.includes(option.key)}
              onChange={() => toggleAngle(option.key)}
            />
            <span style={{ color: option.color }}>{option.label}</span>
          </label>
        ))}
      </div>

      <div className="chart-container">
        <ResponsiveContainer width="100%" height={300}>
          <LineChart data={chartData} margin={{ top: 5, right: 30, left: 20, bottom: 5 }}>
            <CartesianGrid strokeDasharray="3 3" stroke="#333" />
            <XAxis 
              dataKey="time" 
              stroke="#ccc"
              tickFormatter={(value) => `${value.toFixed(1)}s`}
            />
            <YAxis 
              stroke="#ccc"
              label={{ value: 'Angle (degrees)', angle: -90, position: 'insideLeft' }}
            />
            <Tooltip content={<CustomTooltip />} />
            <Legend />

            {selectedAngles.map(angleKey => {
              const option = angleOptions.find(opt => opt.key === angleKey);
              return (
                <Line
                  key={angleKey}
                  type="monotone"
                  dataKey={angleKey}
                  stroke={option.color}
                  strokeWidth={2}
                  dot={false}
                  name={option.label}
                />
              );
            })}
          </LineChart>
        </ResponsiveContainer>
      </div>

      <div className="angle-stats">
        <h4>Angle Statistics</h4>
        <div className="stats-grid">
          {angleOptions.map(option => {
            const values = angleData.map(item => item[option.key] * 180 / Math.PI);
            const avg = (values.reduce((a, b) => a + b, 0) / values.length).toFixed(1);
            const min = Math.min(...values).toFixed(1);
            const max = Math.max(...values).toFixed(1);

            return (
              <div key={option.key} className="stat-item">
                <h5 style={{ color: option.color }}>{option.label}</h5>
                <p>Avg: {avg}째</p>
                <p>Min: {min}째</p>
                <p>Max: {max}째</p>
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
};

export default AngleCharts;
